import { SET_MAILS, LIKE_MAIL, UNLIKE_MAIL, LOADING_DATA } from '../types';

const initialState ={
	mails:[],
	mail:[],
	loading: false
}

export default function(state=initialState, actions) {
	switch(actions.type) {
		case LOADING_DATA:
			return {
				...state,
				loading: true
			}
		case SET_MAILS:
		    return {
		    	...state,
		    	mails: actions.payload
		    }
	}
}
